import React from 'react'
import logo from "../img/logo.svg"
import "../components/navbar.css"

export default function navbar() {
  return (
    <div className="navbar">
      <img src={logo} alt="" />
      <ul>
        <li>SignUp</li>

      </ul>
    </div>
  )
};
